      SUBROUTINE ccsdtq_lambda2_2(d_a,k_a_offset,d_b,k_b_offset,d_c,k_c_
     &offset)
C     i0 ( h3 h4 p1 p2 )_yf + = 1 * P( 4 ) * y ( h3 p1 )_y * i1 ( h4 p2 )_f
