      SUBROUTINE ccsdtq_lambda2_16(d_a,k_a_offset,d_b,k_b_offset,d_c,k_c
     &_offset)
C     i0 ( h3 h4 p1 p2 )_ytv + = 1 * P( 4 ) * Sum ( h12 h10 ) * i1 ( h3 h12 h10 p1 )_yt * v ( h4 h10 h12 p2 )_v
