     &IT('ccsdtq_lambda2_16',2,MA_ERR)
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(h10b_
     &1 - 1 + noab * (p1b_1 - noab - 1 + nvab * (h12b_1 - 1 + noab * (h3
     &b_1 - 1)))))
